// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awChipRenderFunction } from 'js/AwChipService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwChipService', () => import('js/AwChipService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "awChipRenderFunction",
            "deps": "js/AwChipService"
        },
        "hintPopup": {
            "actionType": "popup",
            "options": {
                "placement": "bottom-start",
                "whenParentScrolls": "close",
                "maxHeight": "200px",
                "toggleMode": true,
                "clickOutsideToClose": true,
                "forceCloseOthers": false,
                "autoFocus": false,
                "open": false
            }
        }
    },
    "data": {
        "isRefreshNeeded": true
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "chip": {
            "type": "object"
        },
        "button-type": {
            "type": "string"
        },
        "action": {
            "type": "action"
        },
        "ui-icon-action": {
            "type": "action"
        }
    },
    "_viewModelId": "AwChip",
    "_uniqueViewModelId": "AwChip",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awChipRenderFunction, undefined, ctxImportObj );

export default Component;
